import './App.css';
import Read from './components/combos/read.js';
import Create from './components/combos/create.js';
import Update from './components/combos/update.js';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import ReadRestaurantes from './components/restaurantes/readRestaurante';
import UpdateRestaurante from './components/restaurantes/updateRestaurante';

function App() {
  return (
    <Router>
      <div className='main'>
        <h2 className='main-header'> Combos </h2>
        <Link to='/create'>
          <button>Crear usuario</button>
        </Link>

        <div>
          <Route path="/create" component={Create}></Route>
        </div>

        <div>
          <Route path="/read" component={Read}></Route>
        </div>

        <div>
          <Route path="/update" component={Update}></Route>
        </div>



        <div>
          <Route path="/create" component={CreateRestaurante}></Route>
        </div>

        <div>
          <Route path="/readRestaurantes" component={ReadRestaurantes}></Route>
        </div>

        <div>
          <Route path="/updateRestaurantes" component={UpdateRestaurante}></Route>
        </div>









      </div>
    </Router>






  );
}

export default App;
